import React, {useEffect} from 'react'

const CartList = (cart) => {

    const cartObj = Object.assign({}, cart)

    return (
        <div className = 'cart-list'>
            {cartObj.map((course, index) => (
                <div>{course.id}</div>
            ))}
        </div>
    )

}

export default CartList
